import Navbar from "./Navbar";
import Home from "./Home";
import React from "react";
import {BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="content">
        <Home />
      </div>
      <Routes>
        <Route path="/create" element={<Create/>} />
      </Routes>
    </div>
  );
}

export default App;
